.grid-dashboard {
  display: grid;
  grid-template-columns: 245px 1fr;
  grid-template-rows: 90px 1fr;
  grid-column-gap: 0;
  grid-row-gap: 0;

  header {
    .column-span-2;
    .row-start-1;
  }

  nav {
    .row-start-2;
    .column-span-1;
    min-height: calc(100vh - 90px);
    max-height: calc(100vh - 90px);
  }

